#
# TABLE STRUCTURE FOR: HOTEL
#

DROP TABLE IF EXISTS `HOTEL`;

CREATE TABLE `HOTEL` (
  `ID_HOTEL` varchar(6) COLLATE utf8mb4_unicode_ci NOT NULL,
  `CALLE` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `LOCALIDAD` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `PROVINCIA` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ESTRELLAS` decimal(1,0) unsigned NOT NULL,
  `NOMBRE` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `DISTANCIA_PLAYA` decimal(6,1) DEFAULT NULL,
  `DISTANCIA_CENTRO` decimal(6,1) DEFAULT NULL,
  `PARKING` enum('ABIERTO','CERRADO') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `TRASLADO_AEROPUERTO` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `VALORACION` decimal(2,1) NOT NULL,
  `TIPO` enum('HISTORICO','CONCEPTUAL','MODERNO','TRADICIONAL') COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIENE_ASCENSOR` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `PRESUPUESTO` decimal(11,2) NOT NULL,
  `INGRESOS` decimal(11,2) NOT NULL,
  `PRES_MARKETING` decimal(11,2) NOT NULL,
  `TIENE_SH` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`ID_HOTEL`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



